import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Navbar from "../Navbar";
import Footer from "../Footer";



const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: "white",
    padding: "2vw",
  },
  pic1: {
    maxWidth: "100%",
    height: "auto",
    position: "relative",
    display: "block",
    padding: "2vh",
    paddingTop: "5vh",
    paddingBottom: "3vh",
  },
  pic1Container: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  title: {
      //margin: "35vh 5vw",
      fontSize: "min(7vw, 60px)",
      color: "#0a0a0a",
      margin: "0",
      padding: "0",
  },
  tagline: {
    fontSize: "min(7vw, 40px)",
    color: "#0a0a0a",
    fontWeight: "400",
    margin: "0",
    padding: "0",
    //paddingBottom: "4vh",
  },
  description: {
    fontSize: "min(4vw, 25px)",
    color: "#0a0a0a",
    fontWeight: "400",
    paddingBottom: "4vh",
  },
overview: {
  //display: "flex",
},
overviewElement: {
  fontSize: "min(4vw, 25px)",
  paddingTop: "2vh",
  paddingBottom: "2vh",
},
  empty: {
    height: "80vh",
  },

}));

export default function Template(props) {
    const classes = useStyles();
    const {project, title, tagline, description} = props;

  return (
    <div>
        <Navbar />
        <div className={classes.root}>
          <div className={classes.pic1Container}>
            <img 
              src={`static/projects/${project}/pic1.png`}
              alt="project" 
              className={classes.pic1}
            />
          </div>

          <h2 className={classes.title}>{title}</h2>
          <h3 className={classes.tagline}>{tagline}</h3>
          <p className={classes.description}>{description}</p>
          <div className={classes.overview}>
            <div className={classes.overviewElement}>
              Time Frame: 
            </div>
            <div className={classes.overviewElement}>
              GitHub
            </div>
            <div className={classes.overviewElement}>
              Technologies
            </div>

          </div>
          <div className={classes.empty}></div>

        </div>
        <Footer/>
    </div>
  );
}
